import React, { useContext, useEffect } from "react";
import { FeedContext } from "../../services/feed/feed.context";

export default function Feed() {
    const { feed, getFeed } = useContext(FeedContext);

    useEffect(() => {
        getFeed
    }, [])

    return (
        <div>{JSON.stringify(feed)}</div>
    );
};
